function getIndexToIns(arr, num) {
  if (arr.length == 0){
    return 0;
  }
  arr.sort(function(a, b){return a-b});
  for (let i = 0; i<arr.length; i++){
    if (arr[i]>=num){
      return i;
    }
    if (i==arr.length-1){
      return arr.length;
    }
  }
}

getIndexToIns([5, 3, 20, 3], 5);
